INSERT INTO `info_strings` VALUES (1,'Info Cash-Betaling','<p>Ga naar het OSD-lokaal tijdens de openingsuren om u betaling uit te voeren. Weet je het lokaal niet zijn? <a title=\"Kijk hier!\" href=\"../../pages/guide\" target=\"_self\">Kijk hier</a>!</p>',5,'2011-09-30 14:46:39','2011-10-01 15:58:11',0),(2,'cash','<p>Je kan u cashbetaling uitvoeren in het OSD-lokaal tijdens de openingsuren. Weet je het lokaal nog niet zijn? <a title=\"Kijk hier!\" href=\"../../pages/guide\" target=\"_blank\">Kijk hier!</a></p>\r\n<p>lol</p>',5,'2011-09-30 14:47:05','2011-10-06 09:22:00',0),(3,'transfer','<p>Wenst u te betalen via overschrijving, plaats dan de order key als mededeling in u overschrijving</p>\r\n<p>Overschrijven kan op volgend rekeningnummer: 363-0944543-94</p>',5,'2011-09-30 14:49:08','2011-10-03 12:57:51',0),(4,'general_payment','<p>U bestelling wordt pas behandeld vanaf het ogenblik dat de betaling is ontvangen.</p>\r\n<p>U wordt per mail op de hoogte gebracht bij ontvangst van de overschrijving. Wanneer uw bestelling klaar ligt in het OSD-lokaal wordt dit opnieuw via mail gestuurd',5,'2011-09-30 14:49:25','2011-10-03 10:45:49',0),(5,'about_CD','<p>Infogroep is SOO <strong>10100111001</strong></p>',9,'2011-10-04 14:34:01','2011-10-10 16:26:10',0),(6,'cash','<p>Je kan je bestelling cash komen betalen in het OSD-lokaal tijdens de openingsuren. Geef je order-key aan een van de medewerkers en zij helpen je verder!<br /> <br /><br />Weet je het lokaal nog niet zijn? <a href=\"../../pages/guide\" target=\"_self\">Kijk hier!</a></p>',11,'2011-10-05 13:41:21','2011-10-18 16:40:04',0),(7,'cash','<p>Je kan je bestelling cash komen betalen in het OSD-lokaal tijdens de openingsuren. Geef je order-key aan een van de medewerkers en zij helpen je verder!<br />&nbsp;</p>\r\n<p>Weet je het lokaal nog niet zijn? <a href=\"../../pages/guide\" target=\"_self\">Kijk hier</a>!</p>',3,'2011-10-05 13:42:05','2011-10-16 15:24:41',0),(8,'transfer','<p>Of wil je via overschrijving betalen? Dat kan op het rekeningnummer: 363-0944543-94.<br /><br />Vermeld bij je overschrijving zeker de order-key!</p>\r\n<p>&nbsp;</p>',11,'2011-10-05 13:42:54','2011-10-18 16:40:34',0),(9,'transfer','<p>Of wil je via overschrijving betalen? Dat kan op het rekeningnummer: 363-0944543-94.</p>\r\n<p>Vermeld bij je overschrijving zeker de order-key!</p>',3,'2011-10-05 13:43:03','2011-10-16 15:24:18',0),(10,'general_payment','<p>Je bestelling wordt pas behandeld vanaf het ogenblik dat de je betaling is ontvangen.<br /><br />Je ontvangt een bevestigingsmail wanneer wij je betaling ontvangen.<br /><br />We brengen je via mail op de hoogte, wanneer je bestelling klaar ligt en je deze kan komen halen in het OSD-lokaal.<br /><br /> <br /><br />Tot snel!</p>',11,'2011-10-05 13:43:07','2011-10-18 16:41:05',0),(11,'general_payment','<p>Je bestelling wordt pas behandeld vanaf het ogenblik dat de je betaling is ontvangen.<br /><br />Je ontvangt een bevestigingsmail wanneer wij je betaling ontvangen.</p>\r\n<p>We brengen je via mail op de hoogte, wanneer je bestelling klaar ligt en je deze kan komen halen in het OSD-lokaal.</p>\r\n<p>&nbsp;</p>\r\n<p>Tot snel!</p>',3,'2011-10-05 13:43:27','2011-10-16 15:28:36',0),(12,'cash','<p>Je kan je bestelling cash komen betalen in het OSD-lokaal tijdens de openingsuren. Geef je order-key aan een van de medewerkers en zij helpen je verder!<br /><br /><br />Weet je het lokaal nog niet zijn? <a href=\"../../pages/guide\" target=\"_self\">Kijk hier!</a></p>\r\n<p>&nbsp;</p>',4,'2011-10-05 13:45:25','2011-10-18 16:31:15',0),(13,'cash','<p>Je kan je bestelling cash komen betalen in het OSD-lokaal tijdens de openingsuren. Geef je order-key aan een van de medewerkers en zij helpen je verder!<br /> <br /><br />Weet je het lokaal nog niet zijn? <a href=\"../../pages/guide\" target=\"_self\">Kijk hier</a>!</p>',8,'2011-10-05 13:45:36','2011-10-18 16:03:52',0),(14,'transfer','<p>Of wil je via overschrijving betalen? Dat kan op het rekeningnummer: 363-0944543-9